import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Login from './login/login.jsx';
import Register from './login/register.jsx';
import CandidatesList from './candidates/candidatesList.jsx';
import CandidateProfile from './candidates/candidateProfile.jsx';


function Routing() {
    return (
        <Switch>
            <Route path="/login" component={Login} />
            <Route path="/register" component={Register} />
            <Route path="/candidates/:id" component={CandidateProfile} />
            <Route path="/candidates" component={CandidatesList} />
        </Switch>
    );
}

export default Route;
